"use strict";module.exports={name:"stats",description:"Displays various stats about the bot.",execute:function(n){var e=[n.client.shard.fetchClientValues("guilds.cache.size"),n.client.shard.broadcastEval("this.guilds.cache.reduce((prev, guild) => prev + guild.memberCount, 0)")];Promise.all(e).then(function(e){var t=e[0].reduce(function(e,t){return e+t},0),r=e[1].reduce(function(e,t){return e+t},0);return n.channel.send("Server count: ".concat(t,"\nMember count: ").concat(r,"\nCurrent server is: ").concat(n.guild.name))}).catch(console.error)}};